import '../node_modules/bootstrap/dist/css/bootstrap.min.css'


const App = () => {
  const [num, setNum] = useState(0)
  return (
    <>
       <button className="btn m-5" onClick={((clickEvent) =>{
         setNum(num + 1)
       })}>Click Me {0}</button>
    </>
  )
}
export default App;
